Comment:
@ExhaustedNik  I want to give alternate perspective on that because I see huge gap of understanding about how earning culture in Nepal(specially cities) has shift massively in the past years specially past years. No matter everyone is shocked hearing the earnings but many people in Nepal those who have understood the gig economy, freelancer economy, increase of influencer content creator economy are not as surprised about "her earnings" because we have seen many people who have made it in just few years.Â 

Priyanka and Kabita and few others have talked about how much they make with brand deals - it literally is up to 5 lakhs too for one post in social media. We have seen how a 21 year old kid staying in tiktok live has built a house worth crores(Reference Aayush Alizeh). We have seen freelancer culture growing through platforms like Upwork & also own small businesses working with people across the world(you can find many videos of Nepali explaining about this too & they mention how much they make too like even 10k USD per month, In IT field too many freelancers are cracking it). So, yes she mentioned she paid almost 97 lakhs as Harvard tuition fee & many people are shocked and in denial but many people are not surprised and are mad at her about other things. Looking from outside we only see "bad news of Nepal" but not about flourishing gig economy and culture. Even the food influencers with 20 times less followers than her ask up to 50 k or more  for Insta post. We have seen the trend of many Nepali living abroad returning back to work in Nepal too coz they see the potentials here. 

Perhaps, it's time for us for the new trend of being honest of "how much we make in Nepal & how I do it", Nepali culture doesnt like talking about money, its a shame but seems like it is needed too. Nepal is not as doomed and as worst as shown In the news only, we who are living here keep trying to calculate both bad good in every way too.

@sri-ti100  By the way, Freelancers tax is only 5% hai not 39%, it used to be 2%. Since there are brand deals it might not be actually 39%,

 And Lol, Why you asking me? I am not Shrinkhala lol, Yes income is taxed for 39% BUT FOR SALARY. And Yes, we need to ask every influencers, like Priyanka Karki, the Mount Everest climbers also had said they charge "LAKHS" for one brand shout out, even out beloved food vloggers. We need to ask everyone "HOW MUCH THEY PAY"

LET'S ASK ALL OUR FAVORITE INFLUENCERS HOW MUCH THEY PAID IN TAXES,  NOT JUST SHRINKHALA, LETS ASK PRIYANKA KABITA NISHAL BASNET SISAN BANIYA AND EVERYONE.

@ankitasharma9863 You cant put the "FAKE BRAND NAME" in the sheet at all, you cant put the FAKE EMBASSY NAME specially if you are person of authority and influencers. Those brand deals can be fact checked easily. She is not obligated to show her bank statement to us. To be honest, even didnt need to show that excel sheet. Should have said - "I dont need to show you guys anything, if you have courage then file me a case, if proven guilty I will do what needs to be done". She would have been a multi millionaire in dollars if she had not come to Nepal.

Many of us in Nepal are not surprised with her earnings, bruh, regular influencers makes crores with tiktok live and make house buy cars these days(Example Ayush Eva) but many people specially those abroad still think Nepali dont make money lol. 

It's high time we need to talk about money as Nepali, No shame in earning money legally.
